import React from 'react';
import './navbar.css';
import {  NavLink, Route,Nav } from "react-router-dom";
export default function NavBar(){
    return(
        <>
        <Nav>
            <NavMenu>
            <NavLink to='/' activeStyle>
                <h2>Home</h2>
            </NavLink>
            <NavLink to='/About' activeStyle>
                <h2>About</h2>
            </NavLink>
            <NavLink to='/Contact' activeStyle>
                <h2>Contact</h2>
            </NavLink>
            
            </NavMenu>
        </Nav>
        
        </>
    );
}
